@pytest.fixture
def receipt_object_all_na():
    json_repsonse = json.load(open("./tests/data/expense_receipts/v3/receipt_all_na.json"))
    return Receipt(json_repsonse["predictions"][0])


@pytest.fixture
def receipt_pred():
    return json.load(open("./tests/data/expense_receipts/v3/receipt_all_na.json"))["predictions"][0]


# Technical tests
def test_constructor(receipt_object):
    assert receipt_object.date.value == "2016-02-26"
    assert receipt_object.total_tax.value == 1.7
    assert receipt_object.checklist["taxes_match_total_incl"] is True
    assert type(receipt_object.__str__()) == str


def test_all_na(receipt_object_all_na):
    assert receipt_object_all_na.locale.value is None
    assert receipt_object_all_na.total_incl.value is None
    assert receipt_object_all_na.date.value is None
    assert receipt_object_all_na.merchant_name.value is None
    assert receipt_object_all_na.time.value is None
    assert receipt_object_all_na.orientation.value == 0
    assert receipt_object_all_na.total_tax.value is None
    assert len(receipt_object_all_na.taxes) == 0


def test_checklist_on_empty(receipt_object_all_na):
    for check in receipt_object_all_na.checklist.values():
        assert check is False


# Business tests
def test__reconstruct_total_excl_from_total_and_taxes_1(receipt_pred):
    # no incl implies no reconstruct for total excl
    receipt_pred["total_incl"] = {"value": "N/A", "probability": 0.}
    receipt_pred["taxes"] = [{"rate": 20, "value": 9.5, "probability": 0.9}]
    receipt = Receipt(receipt_pred)
    assert receipt.total_excl.value is None


def test__reconstruct_total_excl_from_total_and_taxes_2(receipt_pred):
    # no taxes implies no reconstruct for total excl
    receipt_pred["total_incl"] = {"value": 12.54, "probability": 0.}
    receipt_pred["taxes"] = []
    receipt = Receipt(receipt_pred)
    assert receipt.total_excl.value is None


def test__reconstruct_total_excl_from_total_and_taxes_3(receipt_pred):
    # working example
    receipt_pred["total_incl"] = {"value": 12.54, "probability": 0.5}
    receipt_pred["taxes"] = [{"rate": 20, "value": 0.5, "probability": 0.1},
                             {"rate": 10, "value": 4.25, "probability": 0.6}]
    receipt = Receipt(receipt_pred)
    assert receipt.total_excl.probability == 0.03
    assert receipt.total_excl.value == 7.79


def test__reconstruct_total_tax_1(receipt_pred):
    # no taxes implies no reconstruct for total tax
    receipt_pred["taxes"] = []
    receipt = Receipt(receipt_pred)
    assert receipt.total_tax.value is None


def test__reconstruct_total_tax_2(receipt_pred):
    # working example
    receipt_pred["taxes"] = [{"rate": 20, "value": 10.2, "probability": 0.5},
                             {"rate": 10, "value": 40.0, "probability": 0.1}]
    receipt = Receipt(receipt_pred)
    assert receipt.total_tax.value == 50.2
    assert receipt.total_tax.probability == 0.05


def test__taxes_match_total_incl_1(receipt_pred):
    # matching example
    receipt_pred["total_incl"] = {"value": 507.25, "probability": 0.6}
    receipt_pred["taxes"] = [{"rate": 20, "value": 10.99, "probability": 0.5},
                             {"rate": 10, "value": 40.12, "probability": 0.1}]
    receipt = Receipt(receipt_pred)
    assert receipt.checklist["taxes_match_total_incl"] is True
    assert receipt.total_incl.probability == 1.
    for tax in receipt.taxes:
        assert tax.probability == 1.


def test__taxes_match_total_incl_2(receipt_pred):
    # not matching example with close error
    receipt_pred["total_incl"] = {"value": 507.25, "probability": 0.6}
    receipt_pred["taxes"] = [{"rate": 20, "value": 10.9, "probability": 0.5},
                             {"rate": 10, "value": 40.12, "probability": 0.1}]
    receipt = Receipt(receipt_pred)
    assert receipt.checklist["taxes_match_total_incl"] is False


def test__taxes_match_total_incl_3(receipt_pred):
    # sanity check with null tax
    receipt_pred["total_incl"] = {"value": 507.25, "probability": 0.6}
    receipt_pred["taxes"] = [{"rate": 20, "value": 0., "probability": 0.5}]
    receipt = Receipt(receipt_pred)
    assert receipt.checklist["taxes_match_total_incl"] is False


def test__taxes_match_total_incl_4(receipt_pred):
    # sanity check with None tax rate
    receipt_pred["total_incl"] = {"value": 507.25, "probability": 0.6}
    receipt_pred["taxes"] = [{"rate": "N/A", "value": 0., "probability": 0.5}]
    receipt = Receipt(receipt_pred)
    assert receipt.checklist["taxes_match_total_incl"] is False
    assert type(str(receipt.taxes[0])) is str


def test_compare_1(receipt_object):
    # Compare same object must return all True
    benchmark = Receipt.compare(receipt_object, receipt_object)
    for value in benchmark.values():
        assert value is True


def test_compare_2(receipt_object, receipt_object_all_na):
    # Compare full object and empty object
    benchmark = Receipt.compare(receipt_object, receipt_object_all_na)
    for key in benchmark.keys():
        assert benchmark[key] is False


def test_compare_3(receipt_object_from_scratch):
    # Compare receipt from class
    benchmark = Receipt.compare(receipt_object_from_scratch, receipt_object_from_scratch)
    for key in benchmark.keys():
        if "__acc__" in key:
            assert benchmark[key] is True


def test_compare_4(receipt_object_from_scratch):
    # Compare receipt from class with empty taxes
    receipt_object_from_scratch.taxes = []
    benchmark = Receipt.compare(receipt_object_from_scratch, receipt_object_from_scratch)
    for key in benchmark.keys():
        if "__acc__" in key:
            assert benchmark[key] is True
        elif "__pre__" in key:
            assert benchmark[key] in [True, None]


def test_empty_object_works():
    receipt = Receipt()
    assert receipt.total_tax.value is None


def test_null_tax_rates_dont_raise():
    invoice = Receipt(
        locale="fr",
        total_incl=12,
        total_excl=15,
        taxes={(1, 0), (2, 20)},
        orientation=0,
        total_tax=3
    )
    assert invoice.checklist["taxes_match_total_incl"] is False
